  const history = useHistory(); // If you're using React Router

  const handleGoBack = () => {
    history.push("/start"); // Replace "/start" with the appropriate route
  };

  return (
    <Container>
      <Button variant="contained" color="primary" onClick={handleGoBack}>
        Go Back
      </Button>
      <Typography
        style={{ textAlign: "center", marginBottom: "20px", marginTop: "20px" }}
        variant="h4"
      >
        Your Quiz Results
      </Typography>
      <List>{/* ... (your existing code for displaying quiz results) */}</List>
    </Container>
  );
};

export default QuizResults;
